// Initialize cart
let poCart = [];

document.addEventListener('DOMContentLoaded', function() {
    // Get DOM elements
    const placeOrder2Btn = document.getElementById('placeOrder2Btn');
    const poStyleGrid = document.getElementById('poStyleGrid');
    const poColorModal = document.getElementById('poColorModal');
    const poSizeModal = document.getElementById('poSizeModal');
    const poCartModal = document.getElementById('poCartModal');
    const poViewOrderBtn = document.getElementById('poViewOrderBtn');
    const poExportBtn = document.getElementById('poExportBtn');
    const modalCloseButtons = document.querySelectorAll('.po-modal-close');

    // Event Listeners
    placeOrder2Btn.addEventListener('click', function() {
        renderStyleGrid();
        document.getElementById('placeOrderModal').style.display = 'block';
    });

    poViewOrderBtn.addEventListener('click', function() {
        renderCartTable();
        poCartModal.style.display = 'block';
    });

    poExportBtn.addEventListener('click', exportToExcel);

    modalCloseButtons.forEach(button => {
        button.addEventListener('click', function() {
            this.closest('.po-modal').style.display = 'none';
        });
    });

    // Close modals when clicking outside
    window.addEventListener('click', function(event) {
        if (event.target.classList.contains('po-modal')) {
            event.target.style.display = 'none';
        }
    });

    // Event delegation for size grid
    document.getElementById('poSizeGrid').addEventListener('click', function(e) {
        if (e.target.classList.contains('po-decrease')) {
            const input = e.target.nextElementSibling;
            input.value = Math.max(0, parseInt(input.value) - 1);
        } else if (e.target.classList.contains('po-increase')) {
            const input = e.target.previousElementSibling;
            input.value = parseInt(input.value) + 1;
        }
    });

    // Save button in size modal
    document.getElementById('poSaveButton').addEventListener('click', function() {
        const inputs = document.querySelectorAll('#poSizeGrid .po-quantity-input');
        inputs.forEach(input => {
            const quantity = parseInt(input.value);
            if (quantity > 0) {
                poAddToCart(
                    input.dataset.style,
                    input.dataset.color,
                    input.dataset.size,
                    quantity
                );
            }
        });
        poUpdateCartSummary();
        poSizeModal.style.display = 'none';
    });
});

// Render Functions
function renderStyleGrid() {
    const poStyleGrid = document.getElementById('poStyleGrid');
    poStyleGrid.innerHTML = '';
    const uniqueStyles = [...new Set(purchaseOrderData.map(item => item.style))];
    
    uniqueStyles.forEach(style => {
        const styleItem = document.createElement('div');
        styleItem.className = 'po-grid-item';
        styleItem.textContent = style;
        styleItem.addEventListener('click', () => poOpenColorModal(style));
        poStyleGrid.appendChild(styleItem);
    });
}

function poOpenColorModal(style) {
    const colorModal = document.getElementById('poColorModal');
    const colorModalTitle = document.getElementById('poColorModalTitle');
    const colorGrid = document.getElementById('poColorGrid');
    
    colorModalTitle.textContent = `Colors for Style ${style}`;
    colorGrid.innerHTML = '';
    
    const colors = [...new Set(purchaseOrderData
        .filter(item => item.style === style)
        .map(item => item.colorName))];
    
    colors.forEach(color => {
        const colorItem = document.createElement('div');
        colorItem.className = 'po-grid-item';
        colorItem.textContent = color;
        colorItem.addEventListener('click', () => poOpenSizeModal(style, color));
        colorGrid.appendChild(colorItem);
    });
    
    colorModal.style.display = 'block';
}

function poOpenSizeModal(style, color) {
    const sizeModal = document.getElementById('poSizeModal');
    const sizeModalTitle = document.getElementById('poSizeModalTitle');
    const sizeModalSubtitle = document.getElementById('poSizeModalSubtitle');
    const sizeGrid = document.getElementById('poSizeGrid');
    
    sizeModalTitle.textContent = `Sizes for Style ${style}`;
    sizeModalSubtitle.textContent = `Color: ${color}`;
    sizeGrid.innerHTML = '';
    
    const sizes = [...new Set(purchaseOrderData
        .filter(item => item.style === style && item.colorName === color)
        .map(item => item.size))];
    
    sizes.forEach(size => {
        const sizeItem = document.createElement('div');
        sizeItem.className = 'po-size-item';
        sizeItem.innerHTML = `
            <span>${size}</span>
            <div class="po-quantity-control">
                <button class="po-decrease">-</button>
                <input type="number" value="0" min="0" class="po-quantity-input" 
                    data-style="${style}" data-color="${color}" data-size="${size}">
                <button class="po-increase">+</button>
            </div>
        `;
        sizeGrid.appendChild(sizeItem);
    });
    
    sizeModal.style.display = 'block';
}

// Cart Functions
function poAddToCart(style, color, size, quantity) {
    const item = purchaseOrderData.find(item => 
        item.style === style && item.colorName === color && item.size === size
    );
    
    if (item) {
        const cartItem = {...item, quantity};
        const existingItemIndex = poCart.findIndex(i => 
            i.style === style && i.colorName === color && i.size === size
        );
        
        if (existingItemIndex > -1) {
            poCart[existingItemIndex].quantity = quantity;
        } else {
            poCart.push(cartItem);
        }
    }
}

function poUpdateCartSummary() {
    const cartItemCount = document.getElementById('poCartItemCount');
    const totalItems = poCart.reduce((sum, item) => sum + item.quantity, 0);
    cartItemCount.textContent = `Cart: ${totalItems} items`;
}

function renderCartTable() {
    const cartTableBody = document.getElementById('poCartTableBody');
    cartTableBody.innerHTML = '';
    
    poCart.forEach(item => {
        const row = document.createElement('tr');
        row.innerHTML = `
            <td>${item.materialCode}</td>
            <td>${item.category}</td>
            <td>${item.style}</td>
            <td>${item.description}</td>
            <td>${item.color}</td>
            <td>${item.colorName}</td>
            <td>${item.stylecol}</td>
            <td>${item.size}</td>
            <td>${item.mrp}</td>
            <td>${item.packsize}</td>
            <td>${item.quantity}</td>
        `;
        cartTableBody.appendChild(row);
    });
}

function exportToExcelWithSheetJS() {
    try {
        // Check if cart is empty
        if (poCart.length === 0) {
            alert('Cart is empty. Please add items before exporting.');
            return;
        }

        // Check if XLSX is available
        if (typeof XLSX === 'undefined') {
            console.error('SheetJS (XLSX) is not loaded');
            return exportToExcel(); // Fallback to basic CSV export
        }

        // Create workbook
        const wb = XLSX.utils.book_new();
        
        // Prepare data in simplified format
        const excelData = poCart.map(item => ({
            'Item Name': item.style,
            'Color': item.color,
            'Size': item.size,
            'Quantity': item.quantity
        }));
        
        // Create worksheet
        const ws = XLSX.utils.json_to_sheet(excelData);
        
        // Set column widths
        const colWidths = [
            { wch: 30 }, // Item Name
            { wch: 15 }, // Color
            { wch: 10 }, // Size
            { wch: 10 }  // Quantity
        ];
        ws['!cols'] = colWidths;

        // Calculate the last row of data
        const lastRow = excelData.length + 1; // +1 for header row

        // Add empty row for spacing
        XLSX.utils.sheet_add_json(ws, [{}], { origin: lastRow + 1 });

        // Add instructions
        const instructions = [
            ["COPY THE ABOVE DATA (DONT COPY HEADER) AND PASTE IT IN THE MAIN ORDER FORMAT OF COMPANY FROM A5838"],
            ["THEN PRESS (Alt + F11) AND CREATE NEW MODULE AND PASTE THE BELOW CODE THERE AND RUN IT"],
            ["CODE:"],
            [`Sub UpdateQuantities()
    Dim lastRow As Long
    Dim formLastRow As Long
    Dim inputRow As Long
    Dim formRow As Long
    Dim ws As Worksheet
    Dim found As Boolean
    Dim unmatchedCount As Long
    
    Set ws = ActiveSheet
    
    ' Find last row of the form (searching up to row 5836)
    formLastRow = 5836
    
    ' Find last row of input data (starting from row 5838)
    lastRow = ws.Cells(ws.Rows.Count, "A").End(xlUp).Row
    
    ' Clear any previous highlighting in the input area
    ws.Range("A5838:D" & lastRow).Interior.ColorIndex = xlNone
    
    unmatchedCount = 0
    
    ' Loop through each input row starting from 5838
    For inputRow = 5838 To lastRow
        found = False
        
        ' Get input values
        Dim inputStyle As String
        Dim inputColor As String
        Dim inputSize As String
        Dim inputQty As Variant
        
        inputStyle = ws.Cells(inputRow, 1).Value  ' Column A
        inputColor = ws.Cells(inputRow, 2).Value  ' Column B
        inputSize = ws.Cells(inputRow, 3).Value   ' Column C
        inputQty = ws.Cells(inputRow, 4).Value    ' Column D
        
        ' Skip empty rows
        If Trim(inputStyle) <> "" Then
            ' Loop through form rows to find matching entry
            For formRow = 1 To formLastRow
                ' Get form values
                Dim formStyle As String
                Dim formColor As String
                Dim formSize As String
                
                formStyle = ws.Cells(formRow, "C").Value   ' Style column
                formColor = ws.Cells(formRow, "E").Value   ' Color column
                formSize = ws.Cells(formRow, "I").Value    ' Size column
                
                ' Check if all criteria match
                If formStyle = inputStyle And _
                   formColor = inputColor And _
                   formSize = inputSize Then
                    
                    ' Update quantity in column M
                    ws.Cells(formRow, "M").Value = inputQty
                    found = True
                    Exit For
                End If
            Next formRow
            
            ' Highlight unmatched entries in red
            If Not found Then
                ' Highlight entire row in light red
                With ws.Range("A" & inputRow & ":D" & inputRow).Interior
                    .Color = RGB(255, 200, 200)  ' Light red color
                End With
                unmatchedCount = unmatchedCount + 1
                
                ' Log unmatched entry details
                Debug.Print "No match found for: Style=" & inputStyle & _
                           ", Color=" & inputColor & _
                           ", Size=" & inputSize
            End If
        End If
    Next inputRow
    
    ' Show completion message with count of unmatched entries
    If unmatchedCount > 0 Then
        MsgBox "Update complete!" & vbNewLine & _
               unmatchedCount & " unmatched entries were found and highlighted in red.", _
               vbInformation
    Else
        MsgBox "Update complete! All entries were successfully matched.", _
               vbInformation
    End If
End Sub`]
        ];

        // Add instructions to worksheet starting from the row after the data plus spacing
        instructions.forEach((row, index) => {
            XLSX.utils.sheet_add_json(ws, [{ 'Item Name': row[0] }], {
                origin: lastRow + 2 + index,
                skipHeader: true
            });
        });
        
        // Add worksheet to workbook
        XLSX.utils.book_append_sheet(wb, ws, 'Purchase Order');
        
        // Generate Excel file and trigger download
        XLSX.writeFile(wb, `purchase_order_${getCurrentDateTime()}.xlsx`);
        
    } catch (error) {
        console.error('Error exporting to Excel with SheetJS:', error);
        exportToExcel(); // Fallback to basic CSV export
    }
}

// Keep the getCurrentDateTime helper function
function getCurrentDateTime() {
    const now = new Date();
    return now.toISOString().replace(/[:.]/g, '-').slice(0, 19);
}

// Modify the basic CSV export function as fallback
function exportToExcel() {
    try {
        // Check if cart is empty
        if (poCart.length === 0) {
            alert('Cart is empty. Please add items before exporting.');
            return;
        }

        // Create CSV content
        let csvContent = 'data:text/csv;charset=utf-8,';
        
        // Add headers (simplified format)
        const headers = ['Item Name', 'Color', 'Size', 'Quantity', 'VBA Code'];
        csvContent += headers.join(',') + '\n';
        
        // Prepare VBA code as a single string with proper escaping
        const vbaCode = `Sub UpdateQuantities()
    Dim lastRow As Long
    Dim formLastRow As Long
    Dim inputRow As Long
    Dim formRow As Long
    Dim ws As Worksheet
    Dim found As Boolean
    Dim unmatchedCount As Long
    
    Set ws = ActiveSheet
    
    ' Find last row of the form (searching up to row 5840)
    formLastRow = 5840
    
    ' Find last row of input data (starting from row 5842)
    lastRow = ws.Cells(ws.Rows.Count, "A").End(xlUp).Row
    
    ' Clear any previous highlighting in the input area
    ws.Range("A5842:D" & lastRow).Interior.ColorIndex = xlNone
    
    unmatchedCount = 0
    
    ' Loop through each input row starting from 5842
    For inputRow = 5842 To lastRow
        found = False
        
        ' Get input values
        Dim inputStyle As String
        Dim inputColor As String
        Dim inputSize As String
        Dim inputQty As Variant
        
        inputStyle = ws.Cells(inputRow, 1).Value  ' Column A
        inputColor = ws.Cells(inputRow, 2).Value  ' Column B
        inputSize = ws.Cells(inputRow, 3).Value   ' Column C
        inputQty = ws.Cells(inputRow, 4).Value    ' Column D
        
        ' Skip empty rows
        If Trim(inputStyle) <> "" Then
            ' Loop through form rows to find matching entry
            For formRow = 1 To formLastRow
                ' Get form values
                Dim formStyle As String
                Dim formColor As String
                Dim formSize As String
                
                formStyle = ws.Cells(formRow, "D").Value   ' Style column (changed from C to D)
                formColor = ws.Cells(formRow, "F").Value   ' Color column (changed from E to F)
                formSize = ws.Cells(formRow, "J").Value    ' Size column (changed from I to J)
                
                ' Check if all criteria match
                If formStyle = inputStyle And _
                   formColor = inputColor And _
                   formSize = inputSize Then
                    
                    ' Update quantity in column M
                    ws.Cells(formRow, "M").Value = inputQty
                    found = True
                    Exit For
                End If
            Next formRow
            
            ' Highlight unmatched entries in red
            If Not found Then
                ' Highlight entire row in light red
                With ws.Range("A" & inputRow & ":D" & inputRow).Interior
                    .Color = RGB(255, 200, 200)  ' Light red color
                End With
                unmatchedCount = unmatchedCount + 1
                
                ' Log unmatched entry details
                Debug.Print "No match found for: Style=" & inputStyle & _
                           ", Color=" & inputColor & _
                           ", Size=" & inputSize
            End If
        End If
    Next inputRow
    
    ' Show completion message with count of unmatched entries
    If unmatchedCount > 0 Then
        MsgBox "Update complete!" & vbNewLine & _
               unmatchedCount & " unmatched entries were found and highlighted in red.", _
               vbInformation
    Else
        MsgBox "Update complete! All entries were successfully matched.", _
               vbInformation
    End If
End Sub`;

        // Add data rows with VBA code in the last column of first row only
        poCart.forEach((item, index) => {
            const row = [
                `"${item.style}"`,
                `"${item.color}"`,
                `"${item.size}"`,
                item.quantity,
                index === 0 ? vbaCode : '' // Add VBA code only to first row
            ];
            csvContent += row.join(',') + '\n';
        });
        
        // Create download link
        const encodedUri = encodeURI(csvContent);
        const link = document.createElement('a');
        link.setAttribute('href', encodedUri);
        link.setAttribute('download', `purchase_order_${getCurrentDateTime()}.csv`);
        document.body.appendChild(link);
        
        // Trigger download
        link.click();
        
        // Cleanup
        document.body.removeChild(link);
    } catch (error) {
        console.error('Error exporting to CSV:', error);
        alert('An error occurred while exporting. Please try again.');
    }
}

